import React from 'react';
import {Navbar} from './Components/Navbar'
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <div className="Page">
          <div id="Greeting">
          Hi,<br/>
          I'm Henry<br/>
          I do all <br/>
          </div>sorts of things.
        </div>
    </div>
  );
}

export default App;
